import { useState } from "react";
import "./DisplayImages.css";

export default function DisplayImages() {
  const [prevImage, setImage] = useState([
    {
      key: "1",
      image:
        "data:image/jpeg;base64,",
      id: 1,
    },
    {
      key: "2",
      image:
        "data:image/jpeg;base64,",
      id: 2,
    },
    {
      key: "3",
      image:
        "data:image/jpeg;base64,",
      id: 3,
    },
    {
      key: "4",
      image:
        "data:image/jpeg;base64,",
      id: 4,
    },
    {
      key: "5",
      image:
        "data:image/jpeg;base64,",
      id: 5,
    },
    {
      key: "6",
      id: 6,
      image:
        "data:image/jpeg;base64,",
    },
    {
      key: "7",
      image:
        "data:image/jpeg;base64,",
      id: 7,
    },
  ]);

  const deleteById = (id) => {
    setImage((oldvalues) => {
      return oldvalues.filter((identity) => identity.id !== id);
    });
  };

  return (
    <>
   
      <div className="display-images">
        {prevImage.map((img) => {
          return (
            <div className="card">
              <li className="list-group-item  list-item" key={img.id}>
                <img
                  src={img.image}
                  className="img-thumbnail rounded"
                  alt=""
                ></img>
                <button
                  type="button"
                  className="close"
                  aria-label="Close"
                  onClick={() => deleteById(img.id)}
                >
                  <span aria-hidden="true" className="cross-mark">
                    &times;
                  </span>
                </button>
              </li>
            </div>
          );
        })}
      </div>
    </>
  );
}
